// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Auction is ReentrancyGuard {
    struct Bid {
        address bidder;
        uint amount;
    }

    // Variables de estado
    address payable public owner;
    uint public endTime;
    uint public minimumBidIncrement;
    address payable public highestBidder;
    uint public highestBid;
    mapping(address => Bid) public bids;

    // Eventos
    event NewBid(address indexed bidder, uint amount);
    event AuctionEnded(address indexed winner, uint winningBid);

    constructor(
        address payable _owner,
        uint _endTime,
        uint _minimumBidIncrement
    ) {
        owner = _owner;
        endTime = _endTime;
        minimumBidIncrement = _minimumBidIncrement;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier auctionIsActive() {
        require(block.timestamp < endTime, "Auction has ended");
        _;
    }

    modifier bidIsValid(uint amount) {
        require(amount > highestBid + (highestBid * minimumBidIncrement / 100), "Bid too low");
        _;
    }

    function bid() external payable nonReentrant auctionIsActive bidIsValid(msg.value) {
        bids[msg.sender] = Bid(msg.sender, msg.value);
        highestBidder = payable(msg.sender);
        highestBid = msg.value;

        // Extender el tiempo de la subasta si es necesario
        if (block.timestamp >= endTime - 10 minutes) {
            endTime += 10 minutes;
        }

        emit NewBid(msg.sender, msg.value);
    }

    function withdrawExcessBid() external payable nonReentrant auctionIsActive {
        uint excess = bids[msg.sender].amount - highestBid;
        require(excess > 0, "No excess to withdraw");

        bids[msg.sender].amount = highestBid;
        payable(msg.sender).transfer(excess);
    }

    function endAuction() external onlyOwner {
        require(block.timestamp >= endTime, "Auction has not ended");

        // ... Lógica para transferir fondos al ganador y devolver depósitos con comisión ...

        emit AuctionEnded(highestBidder, highestBid);
    }
}

